import Navbar from '../ComponentsReno/Navbar'
import Header from './Header'
import AttachFile from '../AttachFile/AttachFile'

function Media() {
    const [active, setActive] = useState(0)
    const [file, setFile] = useState(undefined)
  return (
    <div>
        <Navbar/>
        <div className=' flex justify-center w-screen'>
          <Header active={active} handleActive={(val) => setActive(val)}/>
          <div className=" float-right relative top- right-10"><AttachFile handlefile={(value) =>{ setFile(value); console.log(value)}}/></div>
        </div>
    </div>
  )
}

export default Media
